import React from 'react';

function AboutUs() {
    return (
        <div className="main">
                <h1>About the Songsaver Project...</h1>
                <p>My name is Rohied Abdoella and I am a student at Winc Academy!</p>
                <p>In this assisnment I have created a React Project, called Songsaver. You can add songs you like and store them in a list.</p>
                <p>In this list you can sort the songs by title, Artist, Genre or Rating.</p>
                <p>You can delete songs from the list or delete the entire list.</p>
        </div>
    )
}

export default AboutUs;
